	add("atheism", "{\"term\":\"atheism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"16th century French \u0027athéisme\u0027 from \u0027athée\u0027 (atheist) a loan from Ancient greek (to 1453) \u0027sc\u003dpolytonic|ἄθεος\u0027 (godless) from \u0027ἀ-\u0027 (without) + \u0027θεός\u0027 (deity, god) First English attestation dates to 1587 (OED).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Belief that no deities exist (sometimes including rejection of other religious beliefs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Rejection of belief that any deities exist (with or without a belief that no deities exist\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Absence of belief that any deities exist (including absence of the concept of deities\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"with regard to the \u0027\u0027\u0027atheism\u0027\u0027\u0027 that is natural to all the children of men\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"page \u003d 7 passage \u003d \u0027\u0027\u0027Atheism\u0027\u0027, in its basic form, is not a belief; it is the absence of belief.\u0027 An atheist is not primarily a person who \u0027believes\u0027 that a god does \u0027not\u0027 exist; rather, he does \u0027not believe\u0027 in the existence of a god\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Absence of belief in a particular deity, pantheon, or religious doctrine (notwithstanding belief in other deities\", \"priority\":6}]}, \"synonyms\":{}}");

