	add("atheling", "{\"term\":\"atheling\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"Proto-Germanic\", \"old high german (ca. 750-1050)\", \"old frisian\", \"old saxon\"], \"text\":\"From Middle english (1100-1500) \u0027atheling\u0027 from Old english (ca. 450-1100) \u0027æþeling\u0027 (son of a king, man of royal blood, nobleman, chief, prince, king, christ, god, man, hero, saint) from Proto-germanic {{m|gem-pro|*aþalingaz||prince, nobleman}}, equivalent to {{suffix|athel|ing|lang\u003den}}. Cognate with Old frisian \u0027etheling\u0027 \u0027edling\u0027 Old saxon \u0027edhiling\u0027 Old high german (ca. 750-1050) \u0027adaling\u0027 \u0027adalingus\u0027 \u0027adelingus\u0027 (from Proto-germanic .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A prince, especially an Anglo-Saxon prince or royal heir\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1966\u0027\u0027, Dorothy Whitelock, \u0027The Norman Conquest\u0027, Charles Scribner\u0027s Sons, New York, [http://books.google.com.au/books?id\u003dSlhnAAAAMAAJ\u0026amp;q\u003d%22After+the+atheling%27s+return+from+exile%22+-intitle:%22townie%7Ctownies%22+-inauthor:%22%22\u0026amp;dq\u003d%22After+the+atheling%27s+return+from+exile%22+-intitle:%22townie%7Ctownies%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dQP2OUNoXh6CJB87BgJAB\u0026amp;redir_esc\u003dy page 60\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"to substitute as the Confessor′s heir, the \u0027\u0027Atheling\u0027\u0027 Edward (son of Edmund Ironside), who was then an exile in Hungary. After the \u0027\u0027atheling\u0027\u0027′s return from exile, and his very suspicious death in England in 1057, the Norman duke must surely have realized that his chief opponent in England was likely to be Harold Godwineson\", \"priority\":3}]}, \"synonyms\":{}}");

